import React from 'react';
import { Link } from 'react-router-dom';
import './home.css';

function Home() {
  return (
    <div className='nav-container'>
      <div className='home-menu'>
        <div className='nav-menu'>
          <ul>
            <li><Link to="/"><svg width="24" height="24" fill="currentColor"><path d="..."/></svg> Home</Link></li>
            <li><Link to="Products"><svg width="24" height="24" fill="currentColor"><path d="..."/></svg> Products</Link></li>
            <li><Link to="Albums"><svg width="24" height="24" fill="currentColor"><path d="..."/></svg> Albums</Link></li>
            <li><Link to="About"><svg width="24" height="24" fill="currentColor"><path d="..."/></svg> About Us</Link></li>
            <li><Link to="Login"><svg width="24" height="24" fill="currentColor"><path d="..."/></svg> Login</Link></li>
          </ul>
        </div>
        <div className='welcome'>
          <h1>Welcome to Fashion Blog</h1>
        </div>
      </div>
    </div>
  );
}

export default Home;
